import React from 'react';
import styled from 'styled-components';
import Burger from './Burger';

const Nav = styled.nav`
 background:#997d4f;
  padding: 0 20px;
  display: flex;
  justify-content: space-between;
  @media (max-width: 768px) {
    background:#997d4f;
    height: 0px;
  }
  .logo {
    padding: 15px 0;
  }
`

const Navbar = () => {
  return (
    <Nav>

      <Burger />
    </Nav>
  )
}

export default Navbar
